DROP TABLE IF EXISTS meresek;
DROP TABLE IF EXISTS regiok;

CREATE TABLE regiok (
  id int NOT NULL,
  regioNev varchar(14) NOT NULL,
  CONSTRAINT pk_regio PRIMARY KEY (id)
);

CREATE TABLE meresek (
  id int IDENTITY,
  ev int NOT NULL,
  ho int NOT NULL,
  regioId int NOT NULL,
  perc int NOT NULL,
  CONSTRAINT pk_meresek PRIMARY KEY (id),
  CONSTRAINT fk_meresekRegio FOREIGN KEY (regioId) REFERENCES regiok(id)
);




























































































